import React from 'react'
import Header from './Header'
import { BrowserRouter  as Router ,Routes ,Route} from 'react-router-dom'
import Nav from './Nav'

const Home = () => {
    return (
        
            <Routes>
      
      <Route path ="/co" exact element = {<Nav/>} />
      <Route path ="/coo" exact element = {<Header/>} />
            
           
            </Routes>
        
    )
}

export default Home
